DROP TABLE IF EXISTS `fsn_user`;
CREATE TABLE `fsn_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `usr_name` varchar(20) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '登录名',
