  `usr_key` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '验证码（账号激活码）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

