  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) DEFAULT NULL COMMENT '营养名称',
  `daily_intake` varchar(50) DEFAULT NULL COMMENT '一天摄入量',
  `unit` varchar(255) DEFAULT NULL COMMENT '单位',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='营养标准表';

#
# Data for table "nutri_std"
#

INSERT INTO `nutri_std` VALUES (1,'能量','10000','千焦'),(2,'蛋白质','80','克'),(3,'脂肪','50','克'),(4,'碳水化合物','400','克'),(5,'钠','600','毫克'),(6,'纤维素','100','克');

#
# Source for table "product"
#

DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(200) DEFAULT NULL,
  `status` varchar(50) DEFAULT NULL,
  `format` varchar(200) DEFAULT NULL,
  `regularity` varchar(200) DEFAULT NULL,
  `barcode` varchar(50) DEFAULT NULL,
  `note` text,
  `business_brand_id` bigint(20) DEFAULT NULL,
  `fda_product_group` varchar(20) DEFAULT NULL,
  `producer_id` bigint(20) DEFAULT NULL,
  `qscore_self` float(3,2) DEFAULT '3.00' COMMENT '自检评分',
  `qscore_censor` float(3,2) DEFAULT '3.00' COMMENT '送检评分',
  `qscore_sample` float(3,2) DEFAULT '3.00' COMMENT '抽检评分',
  `imgurl` varchar(500) DEFAULT NULL COMMENT '产品图片url路径',
  `des` text COMMENT '产品描述',
  `cstm` varchar(255) DEFAULT NULL COMMENT '适宜人群',
  `ingredient` varchar(255) DEFAULT NULL COMMENT '主要成分',
  `category` varchar(20) DEFAULT NULL,
  `feature` text,
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_barcode` (`barcode`),
  KEY `fk_product_business_brand` (`business_brand_id`),
  KEY `fk_product_fda_product_group` (`fda_product_group`),
  KEY `idx_name` (`name`),
  KEY `fk_product_business_unit` (`producer_id`),
  CONSTRAINT `fk_product_business_brand` FOREIGN KEY (`business_brand_id`) REFERENCES `business_brand` (`id`),
  CONSTRAINT `fk_product_business_unit` FOREIGN KEY (`producer_id`) REFERENCES `business_unit` (`id`),
  CONSTRAINT `fk_product_fda_product_group` FOREIGN KEY (`fda_product_group`) REFERENCES `fda_product_group` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=10090 DEFAULT CHARSET=utf8;

