  CONSTRAINT `fk_product_instance_product_instance` FOREIGN KEY (`original_id`) REFERENCES `product_instance` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=241 DEFAULT CHARSET=utf8;

